    "ID": "ID",
    "ID-Verification is not required for this Professional Education course.": "A valida\u00e7\u00e3o do ID n\u00e3o \u00e9 necess\u00e1ria para este curso de educa\u00e7\u00e3o profissional.",
    "Identity Verification In Progress": "Verifica\u00e7\u00e3o de identidade em andamento",
    "If a learner starts on {startDate}, this subsection will be due on {projectedDueIn}.": "Se um estudante come\u00e7ar em {startDate}, esta subse\u00e7\u00e3o der\u00e1 estart terminada em {projectedDueIn}.",
    "If the photos you submit are rejected, try moving the computer or camera orientation to change the lighting angle.  The most common reason for rejection is inability to read the text on the ID card.": "Se as fotografias que tirou forem rejeitadas, tente mover a orienta\u00e7\u00e3o do computador ou da c\u00e2mara para alterar o \u00e2ngulo de ilumina\u00e7\u00e3o. A raz\u00e3o mais comum para a rejei\u00e7\u00e3o \u00e9 a incapacidade de ler o texto no cart\u00e3o de identifica\u00e7\u00e3o.",
    "If the subsection does not have a due date, learners always see their scores when they submit answers to assessments.": "Se a subsec\u00e7\u00e3o n\u00e3o tiver uma data limite, os estudantes podem ver as suas pontua\u00e7\u00f5es quando submeterem as respostas \u00e0s avalia\u00e7\u00f5es.",
    "If the unit was previously published and released to learners, any changes you made to the unit when it was hidden will now be visible to learners.": "Caso a unidade j\u00e1 tenha sido publicada e divulgada aos estudantes, quaisquer altera\u00e7\u00f5es que tenham sido feitas na unidade, enquanto estava em modo oculto, estar\u00e3o agora vis\u00edveis para os estudantes.",
    "If the unit was previously published and released to students, any changes you made to the unit when it was hidden will now be visible to students. Do you want to proceed?": "Se a unidade foi previamente publicada e lan\u00e7ada para os estudantes, quaisquer altera\u00e7\u00f5es que tenham sido feitas na unidade quando estava oculta, ficar\u00e3o agora vis\u00edveis para estudantes. Pretende continuar?",
    "If you do not yet have an account, use the button below to register.": "Se ainda n\u00e3o tiver uma conta, clique no bot\u00e3o abaixo para se registar.",
    "If you leave this page without saving or submitting your response, you will lose any work you have done on the response.": "Caso saia desta p\u00e1gina sem gravar ou submeter a sua resposta, ir\u00e1 perder todo o trabalho at\u00e9 aqui realizado.",
    "If you leave this page without submitting your peer assessment, you will lose any work you have done.": "Caso saia desta p\u00e1gina sem submeter o seu teste, ir\u00e1 perder todo o trabalho at\u00e9 aqui realizado.",
    "If you leave this page without submitting your self assessment, you will lose any work you have done.": "Caso saia desta p\u00e1gina sem submeter a sua auto-avalia\u00e7\u00e3o, ir\u00e1 perder todo o trabalho at\u00e9 aqui realizado.",
    "If you leave this page without submitting your staff assessment, you will lose any work you have done.": "Caso saia desta p\u00e1gina sem submeter a sua avalia\u00e7\u00e3o individual, ir\u00e1 perder todo o trabalho at\u00e9 aqui realizado.",
    "If you leave, you can no longer post in this team's discussions.Your place will be available to another learner.": "Se voc\u00ea sair, n\u00e3o poder\u00e1 publicar nas discuss\u00f5es desta equipa, o seu lugar ficar\u00e1 dispon\u00edvel para outro aluno.",
    "If you make significant changes, make sure you notify members of the team before making these changes.": "Se efectuar altera\u00e7\u00f5es significativas, certifique-se de que informa os membros da equipa antes de efectuar as mesmas.",
    "If you make this %(xblockType)s visible to learners, learners will be able to see its content after the release date has passed and you have published the unit. Only units that are explicitly hidden from learners will remain hidden after you clear this option for the %(xblockType)s.": "Se tornar isto %(xblockType)s vis\u00edvel, os estudantes poder\u00e3o ver seu conte\u00fado ap\u00f3s a data de lan\u00e7amento e de ter publicado a unidade. Somente as unidades que est\u00e3o explicitamente ocultas aos estudantes permanecer\u00e3o ocultas depois de desmarcar essa op\u00e7\u00e3o para o %(xblockType)s.",
    "If you proceed, you will be unable to use this account to take courses on the {platformName} app, {siteName}, or any other site hosted by {platformName}.": "Se voc\u00ea prosseguir, n\u00e3o poder\u00e1 usar esta conta para realizar cursos na aplica\u00e7\u00e3o {platformName}, {siteName} ou qualquer outro site hospedado por {platformName}.",
    "If you remove this transcript, the transcript will not be available for any components that use this video.": "Se eliminar esta transcri\u00e7\u00e3o, a transcri\u00e7\u00e3o n\u00e3o estar\u00e1 dispon\u00edvel para quaisquer componentes que utilizam este v\u00eddeo.",
    "If you remove this transcript, the transcript will not be available for this component.": "Se eliminar esta transcri\u00e7\u00e3o, a transcri\u00e7\u00e3o n\u00e3o estar\u00e1 dispon\u00edvel para esta componente.",
    "If you require assistance with taking either photo for submission, contact %(platformName)s support for additional suggestions.": "Se precisar de assist\u00eancia para tirar uma fotografia de submiss\u00e3o, entre em contato com o suporte de %(platformName)s para obter sugest\u00f5es adicionais.",
    "If you select an option other than \"%(hide_label)s\", published units in this subsection become available to learners unless they are explicitly hidden.": "Caso selecione uma op\u00e7\u00e3o diferente de \"%(hide_label)s\", as unidades publicadas nesta subsec\u00e7\u00e3o estar\u00e3o dispon\u00edveis para os estudantes, a menos que sejam explicitamente ocultas. ",
    "If you still wish to continue and delete your account, please enter your account password:": "Se ainda pretende continuar e apagar a sua conta, por favor introduza a sua palavra-passe:",
    "If you use the Advanced Editor, this problem will be converted to XML and you will not be able to return to the Simple Editor Interface.\n\nProceed to the Advanced Editor and convert this problem to XML?": "Se optar por utilizar o Editor Avan\u00e7ado, este problema ser\u00e1 convertido em XML e n\u00e3o poder\u00e1 regressar \u00e0 Interface do Editor Simples.  \n\nProsseguir para o Editor Avan\u00e7ado e converter esse problema em XML?",
