    "Use Current Transcript": "Utilizar a Transcri\u00e7\u00e3o Atual",
    "Use Onboarding to introduce learners to proctoring, verify their identity, and create an onboarding profile. Learners must complete the onboarding profile step prior to taking a proctored exam. Profile reviews take 2+ business days.": "Use Integra\u00e7\u00e3o para introduzir os estudantes ao processo de Supervis\u00e3o de Avalia\u00e7\u00e3o, verificar a sua identidade, e criar um perfil de boas-vindas. Os estudantes devem completar o seu perfil antes de fazer o exame vigiado. As revis\u00f5es de perfil demoram mais de 2 dias \u00fateis.",
    "Use a practice proctored exam to introduce learners to the proctoring tools and processes. Results of a practice exam do not affect a learner's grade.": "Utilize um exerc\u00edcio de exame supervisionado para introduzir os estudantes \u00e0s ferramentas de supervis\u00e3o e aos processos. Os resultados de um exerc\u00edcio de exame n\u00e3o afetam a classifica\u00e7\u00e3o do estudante.",
    "Use a timed exam to limit the time learners can spend on problems in this subsection. Learners must submit answers before the time expires. You can allow additional time for individual learners through the Instructor Dashboard.": "Utilize um exame cronometrado para limitar o tempo dos estudantes em cada problema desta subsec\u00e7\u00e3o. Os estudantes devem submeter as respostas antes de expirar o tempo. Pode conceder tempo adicional para estudantes individuais por meio do painel do formador.",
    "Use as a Prerequisite": "Utilizar como Pr\u00e9-requisito",
    "Use bookmarks to help you easily return to courseware pages. To bookmark a page, click \"Bookmark this page\" under the page title.": "Utilize os favoritos para o ajudar a regressar mais facilmente \u00e0s p\u00e1ginas do material did\u00e1tico. Para marcar uma p\u00e1gina, clique em \"Marcar esta p\u00e1gina\" por baixo do t\u00edtulo da p\u00e1gina.",
    "Use cohorts as the basis for dividing discussions. All learners, regardless of cohort, see the same discussion topics, but within divided topics, only members of the same cohort see and respond to each others\u2019 posts. ": "Use grupos como base para dividir os debates. Todos os estudantes, independentemente do conjunto, v\u00eaem os mesmos t\u00f3picos de debate mas, dentro de t\u00f3picos divididos, apenas os elementos do mesmo grupo v\u00eaem e respondem \u00e0s publica\u00e7\u00f5es dos outros. ",
    "Use enrollment tracks as the basis for dividing discussions. All learners, regardless of their enrollment track, see the same discussion topics, but within divided topics, only learners who are in the same enrollment track see and respond to each others\u2019 posts.": "Use os modos de inscri\u00e7\u00e3o como base para dividir os debates. Todos os estudantes, independentemente do seu modo de inscri\u00e7\u00e3o, v\u00eaem os mesmos t\u00f3picos de debate mas, dentro de t\u00f3picos divididos, apenas os estudantes que est\u00e3o no mesmo modo veem e respondem \u00e0s publica\u00e7\u00f5es dos outros.",
