    "We have encountered an error. Refresh your browser and then try again.": "Foi encontrado um erro. Atualize o seu browser e tente novamente.",
    "We have received your information and are verifying your identity. You will see a message on your dashboard when the verification process is complete (usually within 5-7 days). In the meantime, you can still access all available course content.": "Recebemos a sua informa\u00e7\u00e3o e estamos a verificar a sua identidade. Ver\u00e1 uma mensagem no seu painel de controlo quando o processo de verifica\u00e7\u00e3o estiver conclu\u00eddo (normalmente dentro de 5-7 dias). Entretanto, poder\u00e1 ainda aceder a todo o conte\u00fado dispon\u00edvel do curso.",
    "We just need a little more information before you start learning with %(platformName)s.": "Necessitamos de um pouco mais de informa\u00e7\u00e3o antes de come\u00e7ar a aprender com %(platformName)s.",
    "We securely encrypt your photo and send it to our authorization service for review. Your photo and information are not saved or visible anywhere on %(platformName)s after the verification process is complete.": "Encriptamos a sua fotografia com seguran\u00e7a e enviamos para o nosso servi\u00e7o de autoriza\u00e7\u00e3o para revis\u00e3o. A sua fotografia e informa\u00e7\u00f5es n\u00e3o s\u00e3o guardadas ou vis\u00edveis em qualquer lugar em %(platformName)s ap\u00f3s o processo de verifica\u00e7\u00e3o estar conclu\u00eddo.",
    "We use the highest levels of security available to encrypt your photo and send it to our authorization service for review. Your photo and information are not saved or visible anywhere on %(platformName)s after the verification process is complete.": "Utilizamos n\u00edveis elevados de seguran\u00e7a para encriptar a sua fotografia e envi\u00e1-la para o nosso servi\u00e7o de autoriza\u00e7\u00e3o para ser validada. A sua fotografia e as informa\u00e7\u00f5es n\u00e3o ser\u00e3o salvas ou vis\u00edveis na %(platformName)s ap\u00f3s a conclus\u00e3o do processo de valida\u00e7\u00e3o.",
    "We use your verification photos to confirm your identity and ensure the validity of your certificate.": "Usamos as suas fotografias de verifica\u00e7\u00e3o para confirmar a sua identidade e garantir a validade do seu certificado.",
    "We're sorry to see you go! Your account will be deleted shortly.": "Temos pena que se v\u00e1 embora. A sua conta ser\u00e1 removida imediatamente.",
