    "We've sent a confirmation message to {new_email_address}. Click the link in the message to update your email address.": "Foi enviada uma mensagem de confirma\u00e7\u00e3o para {new_email_address}. Clique no endere\u00e7o da mensagem para atualizar o seu endere\u00e7o de email.",
    "We've sent a confirmation message to {new_secondary_email_address}. Click the link in the message to update your secondary email address.": "Envi\u00e1mos um e-mail de confirma\u00e7\u00e3o para {new_secondary_email_address}. Clique no link referido no e-mail e atualize o seu endere\u00e7o de e-mail secund\u00e1rio.",
