    "When learners submit an answer to an assessment, they immediately see whether the answer is correct or incorrect, and the score received.": "Quando os estudantes submetem uma resposta a uma avalia\u00e7\u00e3o, podem confirmar imediatamente se a resposta est\u00e1 correta ou incorreta e qual a pontua\u00e7\u00e3o recebida.",
    "When your face is in position, use the Take Photo button {icon} below to take your photo.": "Quando a sua cara estiver em posi\u00e7\u00e3o, use o bot\u00e3o Tirar foto {icon} abaixo para tirar uma fotografia.",
    "Which timed transcript would you like to use?": "Qual a transcri\u00e7\u00e3o cronometrada que deseja utilizar?",
    "While our support team is happy to assist with the edX platform, the course staff has the expertise for specific assignment questions, grading or the proper procedures in each course. Please post all course related questions within the Discussion Forum where the Course Staff can directly respond.": "Embora a nossa equipa de apoio tenha o prazer de ajudar com a plataforma edX, o pessoal do curso tem os conhecimentos para quest\u00f5es espec\u00edficas de atribui\u00e7\u00e3o, classifica\u00e7\u00e3o ou os procedimentos adequados em cada curso. Coloque, por favor, todas as perguntas relacionadas com o curso no F\u00f3rum de Discuss\u00e3o onde o pessoal do curso pode responder directamente.",
