    "You may also lose access to verified certificates and other program credentials like MicroMasters certificates. If you want to make a copy of these for your records before proceeding with deletion, follow the instructions for {htmlStart}printing or downloading a certificate{htmlEnd}.": "Poder\u00e1 tamb\u00e9m perder acesso a certificados verificados e a outros programas de certifica\u00e7\u00e3o como os MicroMasters. Se pretender fazer uma c\u00f3pia destes registos antes de apagar a sua conta, siga as instru\u00e7\u00f5es para {htmlStart}imprimir ou transferir um certificado{htmlEnd}.",
    "You may be able to complete the image capture procedure without assistance, but it may take a couple of submission attempts to get the camera positioning right.  Optimal camera positioning varies with each computer, but generally the best position for a headshot is approximately 12-18 inches (30-45 centimeters) from the camera, with your head centered relative to the computer screen. ": "Poder\u00e1 ser capaz de completar o procedimento de captura de imagem sem assist\u00eancia, mas pode levar algumas tentativas de submiss\u00e3o para acertar o posicionamento da c\u00e2mara. O posicionamento ideal da c\u00e2mara varia de acordo com cada computador, mas geralmente a melhor posi\u00e7\u00e3o para uma fotografia de perfil \u00e9 de aproximadamente 30-45 cent\u00edmetros da c\u00e2mara, com a cabe\u00e7a centrada em rela\u00e7\u00e3o ao ecr\u00e3 do computador. ",
    "You may be able to complete the image capture procedure without assistance, but it may take a couple of submission attempts to get the camera positioning right.  Optimal camera positioning varies with each computer, but generally, the best position for a photo of an ID card is 8-12 inches (20-30 centimeters) from the camera, with the ID card centered relative to the camera. ": "Poder\u00e1 conseguir completar o procedimento de captura de imagem sem assist\u00eancia, mas poder\u00e1 ser necess\u00e1rio um par de tentativas de submiss\u00e3o para obter o posicionamento correcto da c\u00e2mara. O posicionamento ideal da c\u00e2mara varia em cada computador, mas geralmente, a melhor posi\u00e7\u00e3o para uma fotografia de um cart\u00e3o de identifica\u00e7\u00e3o \u00e9 de 8-12 polegadas (20-30 cent\u00edmetros) da c\u00e2mara, com o cart\u00e3o de identifica\u00e7\u00e3o centrado em rela\u00e7\u00e3o \u00e0 c\u00e2mara. ",
